local ScreenGui = Instance.new("ScreenGui")
local asd = Instance.new("TextButton")
local closeButton = Instance.new("TextButton")


ScreenGui.Parent = game.Players.LocalPlayer:WaitForChild("PlayerGui")
ScreenGui.ZIndexBehavior = Enum.ZIndexBehavior.Sibling

asd.Name = "asd"
asd.Parent = ScreenGui
asd.BackgroundColor3 = Color3.fromRGB(0, 0, 0)
asd.BackgroundTransparency = 0.8 
asd.BorderColor3 = Color3.fromRGB(0, 0, 0)
asd.BorderSizePixel = 0
asd.Position = UDim2.new(0.470781356, 0, 0.610024452, 0)
asd.Size = UDim2.new(0, 200, 0, 50)
asd.Font = Enum.Font.SourceSans
asd.Text = "Get key"
asd.TextColor3 = Color3.fromRGB(255, 255, 255)
asd.TextSize = 20.000

local UICorner1 = Instance.new("UICorner")
UICorner1.CornerRadius = UDim.new(0, 12) 
UICorner1.Parent = asd

closeButton.Name = "closeButton"
closeButton.Parent = asd 
closeButton.BackgroundColor3 = Color3.fromRGB(255, 0, 0)
closeButton.BackgroundTransparency = 0.5 
closeButton.BorderColor3 = Color3.fromRGB(255, 0, 0)
closeButton.BorderSizePixel = 0
closeButton.Position = UDim2.new(1, -25, 0, 5)  
closeButton.Size = UDim2.new(0, 20, 0, 20)
closeButton.Font = Enum.Font.SourceSans
closeButton.Text = "X"
closeButton.TextColor3 = Color3.fromRGB(255, 255, 255)
closeButton.TextSize = 14.000

local UICorner2 = Instance.new("UICorner")
UICorner2.CornerRadius = UDim.new(0, 6) 
UICorner2.Parent = closeButton

closeButton.MouseButton1Click:Connect(function()
    asd:Destroy()
end)

asd.MouseButton1Click:Connect(function()
    setclipboard('https://eleutheri.com/rewards/?id=b8ad99ca-d79f-4ff4-a468-9a65efdef9d5')
end)

local dragging
local dragInput
local dragStart
local startPos

local function update(input)
    local delta = input.Position - dragStart
    asd.Position = UDim2.new(startPos.X.Scale, startPos.X.Offset + delta.X, startPos.Y.Scale, startPos.Y.Offset + delta.Y)
end

asd.InputBegan:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.MouseButton1 then
        dragging = true
        dragStart = input.Position
        startPos = asd.Position

        input.Changed:Connect(function()
            if input.UserInputState == Enum.UserInputState.End then
                dragging = false
            end
        end)
    end
end)

asd.InputChanged:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.MouseMovement then
        dragInput = input
    end
end)

game:GetService("UserInputService").InputChanged:Connect(function(input)
    if dragging and input == dragInput then
        update(input)
    end
end)
